    [],nt"revision_timestamp": "2014-09-17T17:54:50.859510",nt"name": "demographic-data-census-blockgroups-tiger2011-in-census-block-group-areas-for-indiana-in-2011-",nt"isopen":
    false,nt"url": null,nt"notes": "CENSUS_BLOCKGROUPS_TIGER2011_IN.SHP is
    a polygon shapefile that contains 2011 census block group boundaries for the state
    of Indiana. Census block groups are not legal boundaries, but are considered stable
    geographic units used for the presentation of decennial census data. The following
    is excerpted from an Adobe Acrobat PDF document named "TGRSHP2011_TECHDOC.PDF (U.S.
    Census Bureau): "Block groups are clusters of blocks within the same census tract
    that have the same first digit of their 4-digit census block number. For example,
    blocks 3001, 3002, 3003, u00e2u0080u00a6., 3999 in census tract 1210.02 belong to
    Block Group 3. As with block groups delineated for Census 2000, block groups delineated
    for 5-38 the 2010 Census generally contain between 600 and 3,000 people. Most block
    groups were delineated by local participants in the Census Bureau's Participant
    Statistical Areas Program. The Census Bureau delineated block groups only where
    a local or tribal government declined to participate or where the Census Bureau
    could not identify a potential local participant. "A block group usually covers
    a contiguous area. Each census tract contains at least one block group and block
    groups are uniquely numbered within census tract. Within the standard census geographic
    hierarchy, block groups never cross county or census tract boundaries, but may cross
    the boundaries of county subdivisions, places, urban areas, voting districts, congressional
    districts, and American Indian, Alaska Native, and Native Hawaiian areas. "Block
    groups have a valid range of 0 through 9. Block groups beginning with a 0 generally
    are in coastal and Great Lakes water and territorial seas. Rather than extending
    a census tract boundary into the Great Lakes or out to the three-mile territorial
    sea limit, the Census Bureau delineated some census trac boundaries along the shoreline
    or just offshore. The Census Bureau assigned a default census tract number of 0
    and block group of 0 to the offshore areas not included in regularly numbered census
    tract areas. Because of updates since 2000, there are 0 block groups that now contain
    land."",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
